            // onChange={(e) => hasChange(e)}
          ></input>
          <span>{errors.email?.message}</span>
          {/* <span>{error.email}</span> */}
          <br></br>
          <label className="label">Password:</label>
          <input
            type="password"
            name="password"
            className="pswFields"
            {...register("password")}
