            // onChange={(e) => hasChange(e)}
          ></input>
          <span>{errors.password?.message}</span>
          <span>{error.login}</span>
          {/* <span>{error.password}</span> */}
          <br></br>
          <button type="submit" id="submit" className="ViewBtn">
            Submit
          </button>
          <br></br>
        </form>
        <Link to={"/public/registration"} className="loginBtn">
          Registration
        </Link>
      </div>
    </>
  );
};

